import React from "react";
import Item from "./Item";
import LoginIcon from "../../icons/log_in.png";  // Иконка для обычного состояния
import LoginIconHover from "../../icons/log_in_hover.png";  // Иконка для состояния наведения
import ProfileIcon from "../../icons/profile.png";  // Иконка для обычного состояния
import ProfileIconHover from "../../icons/profile_hover.png";  // Иконка для состояния наведения

const AccountMenu = () => {
  return (
    <div className="account-menu">
      <h1 className="account-title">Account Pages</h1>
      <Item
        text="Log in"
        defaultIcon={LoginIcon}
        hoverIcon={LoginIconHover}
        onClick={() => alert("Button clicked!")}
        className="custom-class"
      />
      <Item
        text="Profile"
        defaultIcon={ProfileIcon}
        hoverIcon={ProfileIconHover}
        onClick={() => alert("Profile clicked!")}
        className="profile-button"
      />
    </div>
  );
};

export default AccountMenu;
